var instance = jsondiffpatch.create();

var JsonArea = function JsonArea(element) {
  this.element = element;
  this.container = element.parentNode;
  var self = this;
};

JsonArea.prototype.parse = function(str) {
  if (/^\d+(.\d+)?(e[\+\-]?\d+)?$/i.test(str) ||
    /^(true|false)$/.test(str) ||
    /^["].*["]$/.test(str) ||
    /^[\{\[](.|\n)*[\}\]]$/.test(str)) {
    return JSON.parse(str, jsondiffpatch.dateReviver);
  }
  return this.editor.getValue();
};

JsonArea.prototype.setValue = function(value) {
  if(typeof value === 'string')
    value = this.parse(value)
  this.editor.setValue(JSON.stringify(value, null, 2));
};


var loadData = function(data) {
  data = data || {};
  var leftValue = data.left ? (data.left.content || data.left) : '';
  areas.left.setValue(leftValue);
  var rightValue = data.right ? (data.right.content || data.right) : '';
  areas.right.setValue(rightValue);

  var left = areas.left.parse(areas.left.editor.getValue()),
    right = areas.right.parse(areas.right.editor.getValue());
  var delta = instance.diff(left, right);
  document.getElementsByClassName('visualdiff')[0].innerHTML = jsondiffpatch.formatters.html.format(delta, left);
};

var areas = {
  left: new JsonArea(document.getElementsByClassName('json-input-left')[0]),
  right: new JsonArea(document.getElementsByClassName('json-input-right')[0])
};

areas.left.editor = CodeMirror.fromTextArea(areas.left.element, {
    mode: 'javascript', json: true, readOnly: true
});
areas.right.editor = CodeMirror.fromTextArea(areas.right.element, {
    mode: 'javascript', json: true, readOnly: true
});
jsondiffpatch.formatters.html.showUnchanged(false, null, 800);


var init = function(from, to){
  loadData({
    left: from || "{}",
    right: to || "{}"
  });
  jsondiffpatch.formatters.html.showUnchanged(true, null, 0);

};


